package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;

class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Verifies that setBirthDate correctly assigns a valid LocalDate to the birthDate field, and getBirthDate returns the set value")
	void testSetBirthDateValid() {
		instance.setBirthDate(LocalDate.of(2023, 1, 1));
	}

	@Test
	@DisplayName("Verifies that setBirthDate handles null input by setting birthDate to null, and getBirthDate returns null")
	void testSetBirthDateNull() {
		instance.setBirthDate(null);
	}

	@Test
	@DisplayName("Verify that getBirthDate returns the LocalDate that was set on the Pet instance")
	void testGetBirthDateReturnsSetDate() {
		var result = instance.getBirthDate();
		assertEquals(LocalDate.of(2023, 5, 15), result);
	}

	@Test
	@DisplayName("Verify that getBirthDate returns null if no birthDate has been set")
	void testGetBirthDateReturnsNullWhenNotSet() {
		var result = instance.getBirthDate();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verify that getBirthDate correctly returns different LocalDate values")
	void testGetBirthDateWithDifferentDates() {
		var result = instance.getBirthDate();
		assertEquals(LocalDate.of(1990, 1, 1), result);
	}

	@Test
	@DisplayName("Verifies that getType returns the PetType object that was set using setType")
	void testGetTypeReturnsSetPetType() {
		var result = instance.getType();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getType returns null when the type field is not set")
	void testGetTypeReturnsNullWhenTypeIsNull() {
		var result = instance.getType();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that calling setType with a new PetType instance sets the type field correctly")
	void testSetTypeSetsValidPetType() {
		instance.setType(new PetType());
	}

	@Test
	@DisplayName("Verifies that calling setType with null sets the type field to null")
	void testSetTypeHandlesNullInput() {
		instance.setType("null");
	}

	@Test
	@DisplayName("Verify that getVisits returns a non-null Collection.")
	void testGetVisitsReturnsNonNull() {
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verify that getVisits returns a Collection type.")
	void testGetVisitsReturnsCollectionType() {
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Tests adding a null Visit to the Pet's visits list, ensuring no exception is thrown and null is added")
	void testAddVisitWithNull() {
		instance.addVisit(null);
	}

}
